import React from 'react';
import styled from 'styled-components';

const Navbar = () => {
    return (
        <>
            <NavbarContainer>
                <div className="navbar">
                    <div className="logo">
                        <span>Netflix</span>
                    </div>
                    <div className="rightside">
                        <select>
                            <option>English</option>
                            <option>Hindi</option>
                        </select>
                        <span>Sign Up</span>
                    </div>
                </div>
            </NavbarContainer>
        </>
    )
}

const NavbarContainer = styled.div`
    position:relative;
    color:white;
    padding: 0px 4rem;
    .logo{
        span{
            color:red;
            transform:uppercase;
        }
    }
`

export default Navbar;
